    false,nt"url": null,nt"notes": "The Community Development Block Grant (CDBG)
    program is a flexible program that provides communities with resources to address
    a wide range of unique community development needs. Beginning in 1974, the CDBG
    program is one of the longest continuously run programs at HUD. The CDBG program
    provides annual grants on a formula basis to of local and state governments. The
    annual CDBG appropriation is allocated between States and local jurisdictions called
    non - entitlement and entitlement communities respectively. Entitlement communities
    are comprised of the principal cities of Metropolitan Statistical Areas; metropolitan
    cities with populations of at least 50,000; and qualified urban counties with a
    population of 200,000 or more (excluding the populations of entitlement cities).
    States distribute CDBG funds to non-entitlement localities not qualified as entitlement
    communities. HUD determines the amount of each grant by using a formula comprised
    of several measures of community need, including the extent of poverty, population,
    housing overcrowding, age of housing, and population growth lag in relationship
    to other metropolitan areas.",nt"license_title": "License Not Specified",nt"extras":
